Os parâmetros de uma função podem ser acessados apenas em seu corpo, isso significa que n pode ser acessado em foo mas não em bar: int foo(int n)
{ return n; // Okay
} int bar(void)
{ return n; // Erro: n não existe nesse contexto
} Isso se chama escopo de bloco, ou seja, o identificador é acessível dentro do bloco ({}) envolvente. No caso da seguinte variável n, seu escopo inicia em sua declaração e termina no final do bloco. int foo(void)
{ int n; return n; // Okay
} int bar(void)
{ return n; // Erro: n não existe nesse contexto
} Um identificador também não pode ser definido duas vezes no mesmo bloco, mas blocos podem ser aninhados: int foo(void)
{ int n; int n; // Erro: n já foi definido nesse bloco
} int bar(void)
{ int n; { int n; // Okay: Este n está contido apenas nesse bloco }
} Vale lembrar que mesmo sendo o mesmo identificador, n representa uma entidade diferente em cada escopo em que é declarado: int foo(void)
{ int n = 5; { int n = 10; return n; // Isso retorna 10 e não 5, pois a redeclaração de n torna o n // anterior inacessível } return n; // Isso retorna 5 pois o escopo do segundo n termina e o primeiro // volta a estar acessível
} Caso um identificador não seja redeclarado em um bloco aninhado, sua declaração original será acessada: int foo(void)
{ int n = 5; { return n; // Isso retorna 5 }
}

