A função printf, diferente de puts, tem a capacidade de formatar os dados antes de exibi-los. O primeiro parâmetro da função é uma string de formato, que informa à função a série de operações de saída a serem realizadas. A string "Hello, World!", ao ser usada como string de formato, faz com que printf simplesmente a exiba. Para realizarmos operações de saída mais complexas, utilizamos especificações de conversão—e.g. %d. %: Introduz uma especificação de conversão. d: Um especificador de conversão que indica um valor do tipo int em base 10. Ao exibir, printf substitui as especificações de conversão pelos valores dos argumentos recebidos. Exemplo com um argumento // %d é substituído pelo argumento 5
printf("O valor de 5 é %d", 5); O valor de 5 é 5 Quando há várias especificações de conversão, a enésima especificação é substituída pelo enésimo argumento após a string de formato. Exemplo com vários argumentos // O 1º %d é substituído pelo 1º argumento após a string de formato (5)
// O 2º %d é substituído pelo 2º argumento após a string de formato (9)
printf("O valor de 5 é %d e o valor de 9 é %d", 5, 9); O valor de 5 é 5 e o valor de 9 é 9 Para os diversos tipos há diversos especificadores de conversão. Vejamos alguns deles: Especificador Significado c Um char, exibido como um caractere u Um unsigned, exibido em base 10 f Um double, exibido com 6 casas decimais por padrão s Uma string Especificação %s // %s é substituído por "World".
printf("Hello, %s!", "World"); Hello, World! Especificação %f // %f é substituído pelo valor da expressão acos(-1), função de <math.h>.
// Isso exibirá um valor aproximado de π com 6 casas decimais, e pode variar
// conforme o seu sistema. Teste você mesmo.
printf("O valor de pi é %f", acos(-1)); Especificação %c // %c é substituído pelo caractere "+".
printf("1 %c 1", '+'); 1 + 1 Diferente do que acontece com puts, o repetido uso de printf acima irá exibir toda a saída em uma linha apenas. Para iniciar uma nova linha utilize a sequência de escape \n no final da string de formato anterior ou no início da string de formato atual. Exemplo printf("Hello, %s!\n", "World");
printf("Goodbye, %s!", "World"); Ou, alternativamente: printf("Hello, %s!", "World");
printf("\nGoodbye, %s!", "World"); Duas linhas em um printf Nos exemplos acima seria melhor utilizar printf apenas uma vez. Aqui estão duas formas de exibir duas linhas com apenas um printf: printf("Hello, %s!\n" "Goodbye, %s!", "World", "World"); printf("Hello, %s!\nGoodbye, %s!", "World", "World"); Na primeira opção acima os primeiros dois literais string se tornam um argumento só, efetivamente causando o mesmo resultado que a segunda opção. Esse processo foi explicado em Função puts . %f para float? O especificador de conversão f irá funcionar até quando o argumento correspondente for float e o especificador d irá funcionar até quando o argumento correspondente for short. A razão disso é um assunto mais avançado.

