O primeiro programa que várias pessoas costumam escrever consiste em exibir "Hello, World!" ("Olá, Mundo!" em inglês). Um simples código C para essa tarefa é o seguinte: #include <stdio.h> int main(void)
{ puts("Hello, World!"); return 0;
} Códigos-fonte C costumam estar em arquivos com extensão "c", portanto digamos que o código acima é o conteúdo do arquivo "main.c". Esse código simples é composto por várias partes. Primeiro, <stdio.h> é o arquivo que fornece as principais funções de entrada e saída no C. A linha #include <stdio.h> essencialmente permite ao programa usar essas funções. main é o ponto de entrada do programa, ou seja, onde começa a execução do código. As chaves { e } representam o corpo do main, e o código entre elas será executado. A primeira tarefa realizada em nosso main é a linha puts("Hello, World!");. puts é uma das funções de entrada e saída fornecidas em <stdio.h>, e ela exibe seu argumento—"Hello, World!"—na tela. Logo após isso temos a linha return 0;, que termina a execução da função. Em main, retornar 0 indica que o programa executou corretamente.
